import React from "react";

const Homepage = (props) => {
    const [toggle, setToggle] = useState(true);
    setInterval(() => {
        if (toggle) {
            setToggle(false);
        } else {
            setToggle(true)
        }
        console.log(toggle)
    }, 1500);
}

export default Homepage;
